CREATE DEFINER=`root`@`localhost` PROCEDURE `procedureAllInforFacult` ()  BEGIN
    SELECT * FROM facultis INNER JOIN faculty_details ON faculty_details.faculty_id = facultis.id WHERE facultis.disable = 1;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `procedureChartStudent` ()  BEGIN
    SELECT faculty_specializeds.faculty_id, facultis.faculty_name, sum(number_student) FROM faculty_specializeds INNER JOIN facultis on facultis.id = faculty_specializeds.faculty_id GROUP BY faculty_specializeds.faculty_id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `procedureIntro` (IN `id` INT)  BEGIN
    SELECT * FROM facultis INNER JOIN faculty_introduces ON faculty_introduces.id = id;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `procedureLogin` (IN `_username` VARCHAR(50), IN `_password` VARCHAR(20))  BEGIN
    SELECT * FROM admins WHERE username = _username and password = _password;
END$$

